/**
 * @param {character[]} s
 * @return {void} Do not return anything, modify s in-place instead.
 */
var reverseString = function(s) {
  if (s.length < 2) return  

  console.log(s.slice(Math.floor(s.length / 2)))
  console.log(s.slice(0, Math.floor(s.length / 2)))
  console.log("+++++++++++")
  s = reverseString(s.slice(Math.floor(s.length / 2))) + reverseString(s.slice(0, Math.floor(s.length / 2)))
  console.log("TCL: reverseString -> s", s)
  // console.log(s)
};

